          <td parentName="tr" {...{
            "align": null
          }}>{`常见问题-Docker相关`}</td>
        </tr>
      </tbody>
    </table>
    <h2 {...{
      "id": "问题现象"
    }}>{`问题现象`}</h2>
    <p>{`主机重启后，docker上的容器无法启动，报错如下`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`# docker restart nginx-proxy
Error response from daemon: Cannot restart container nginx-proxy: error creating overlay mount to /var/lib/docker/overlay2/7431ad53435c5cb52cc24ecc7263b580d4087e2c25e0d4c4c14c577a32ad3607/merged: invalid argument
`}</code></pre>
    <h2 {...{
      "id": "问题原因"
    }}>{`问题原因`}</h2>
    <p>{`通过系统日志可以看到如下报错：
`}<img parentName="p" {...{
        "src": "https://zerchin.gitee.io/picturebed/img/selinux%E8%B8%A9%E5%9D%91%E7%AF%87-docker%E5%AE%B9%E5%99%A8%E6%97%A0%E6%B3%95%E5%90%AF%E5%8A%A8.assets/message-log.png",
        "alt": "message-log"
      }}></img></p>
    <p>{`该问题的主要原因是操作系统之前开启过selinux，在此前提下启动docker并创建了该容器，于是docker的启动参数中会携带某些selinux配置，随后又修改了/etc/selinux/config的配置，将selinux设置为disabled的状态，但是此时selinux的disabled还未生效，而要使selinux的disabled生效，需要重启主机。所以在重启主机前，selinux的状态还是开启的，容器都是能够正常运行。`}</p>
    <p>{`当重启主机后，/etc/selinux/config下的配置就开始生效，selinux就会被设置为disabled的状态，此时容器的配置中还携带有selinux的配置，当启动容器时，会携带这些配置去访问selinux服务，此时selinux是不可用的状态，所以容器就会抛出异常无法启动。`}</p>
    <h2 {...{
      "id": "问题解决"
    }}>{`问题解决`}</h2>
    <ol>
      <li parentName="ol">{`重新启用selinux，然后重启主机即可。`}</li>
    </ol>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`> cat /etc/selinux/config 

# This file controls the state of SELinux on the system.
# SELINUX= can take one of these three values:
#     enforcing - SELinux security policy is enforced.
#     permissive - SELinux prints warnings instead of disabled.
#     disabled - No SELinux policy is loaded.
SELINUX=enforcing
# SELINUXTYPE= can take one of three values:
#     targeted - Targeted processes are protected,
#     minimum - Modification of targeted policy. Only selected processes are protected. 
#     mls - Multi Level Security protection.
SELINUXTYPE=targeted

> reboot
`}</code></pre>
    <p>{`selinux 主要作用就是最大限度地减小系统中服务进程可访问的资源，但是如果对selinux不是很懂的情况下，开启selinux可能还会引起其他问题，此时建议采用第二种方法`}</p>
    <ol {...{
      "start": 2
    }}>
      <li parentName="ol">{`修改容器的配置，将 MountLabel 和 ProcessLabel 两个参数的值设置为空`}<inlineCode parentName="li">{`"MountLabel":"","ProcessLabel":""`}</inlineCode>{`，然后重启docker服务，容器即可修复`}</li>
    </ol>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`cd /var/lib/docker/containers/<container_id>/
cat config.v2.json
`}</code></pre>
    <p><img parentName="p" {...{
        "src": "https://zerchin.gitee.io/picturebed/img/selinux%E8%B8%A9%E5%9D%91%E7%AF%87-docker%E5%AE%B9%E5%99%A8%E6%97%A0%E6%B3%95%E5%90%AF%E5%8A%A8.assets/docker-config-2.png",
        "alt": "docker-config"
      }}></img></p>
    <p>{`从上图中可以发现， MountLabel和ProcessLabel中都携带了selinux的参数，于是将这两个参数的值都设置为空，然后重启docker（直接修改配置无法生效，需要重启docker才能生效），容器启动成功`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`> vi config.v2.json
...
...
"MountLabel":"","ProcessLabel":""
...
...

> systemctl restart docker
> docker ps |grep nginx
037bd8327183        nginx:1.14                      "nginx -g 'daemon of…"   About 18 hour ago   Up 11 seconds                           nginx-proxy
`}</code></pre>
